export const Protected = () => {
    alert("AAAAAAAAAAAAAAAAAAAAAAAAAAA")
        const history = useHistory();
        const storedData = JSON.parse(localStorage.getItem("MyUser"));
        if (!storedData._id) {
            return history.push("/");
        }
}
